import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    user: null,
  },
  mutations: {
    setUser (user)  {
      this.state.user = user
    }
  },
  getters: {
    getUser () {
      return this.state.user
    }
  },
  actions: {

  }
})
